<script src="lib/customScripts.js"></script>

<script>
	var currentSlide;

	let slides = [];
	$.ajax({
		url: "lib/animates.json",
		async: false
	}).done((response) => {
		slides = response;
	});

	const regex = /[0-9]+$/;
	const btnBackPressed = (keyCode1) => {
		return keyCode1 === 37 || keyCode1 === 40 || keyCode1 === 33;
	};
	const btnForwardPressed = (keyCode1) => {
		return keyCode1 === 38 || keyCode1 === 39 || keyCode1 === 44;
	};
	const getPrevSlideId = (currentSlideId) => {
		let prevSlideId = currentSlideId;
		slides.forEach(function (currentSlide, idx, thisArray) {
			if (currentSlide.id === currentSlideId) {
				const firstElementId = 0;
				if (idx == firstElementId) {
				   prevSlideId = thisArray[firstElementId].id;
				} else {
					prevSlideId = thisArray[idx - 1].id;
				}
			}
		}, currentSlideId);
	
		return prevSlideId;
	};
	const getNextSlideId = (currentSlideId) => {
		let nextSlideId = currentSlideId;
		slides.forEach(function (currentSlide, idx, thisArray) {
		  if (currentSlide.id === currentSlideId) {
			  const lastElementId = thisArray.length - 1;
			  if (idx == lastElementId) {
				  nextSlideId = thisArray[lastElementId].id;
			  } else {
				  nextSlideId = thisArray[idx + 1].id;
			  }
		  }
	  }, currentSlideId);
  
	  return nextSlideId;
	};
	const playSound = (soundNameWithExt) => {
		let sound = new Audio();
		sound.src = `sounds/${soundNameWithExt}`;
		sound.autoplay = true;
	};
	
	Reveal.addEventListener( 'slidechanged', function( event ) {

	});

	function handle(slide) {

		const currentAnimations = slide.animations;
		const currentSlideId = slide.id;
		const prevSlideId = getPrevSlideId(currentSlideId);
		const nextSlideId = getNextSlideId(currentSlideId);
		const animationCount = currentAnimations.length;

		let animationNumber = 0;
		$.each(currentAnimations, (idx, animation) => {
			$(animation.id).toggle();
		});

		$(currentSlideId).on('keydown', (eventObject) => {
			let keyCode1 = eventObject.which;
			const allAnimationsHidden = currentAnimations.every(animation => {
				return $(animation.id).css('display') === 'none';
			});

			if (allAnimationsHidden && btnBackPressed(keyCode1)) {
				setTimeout(function () {
					$(prevSlideId).focus();
				}, 500);
				Reveal.prev();

				return;
			}

			if (btnBackPressed(keyCode1)) {
				$.each(currentAnimations, (idx, animation) => {
					$(animation.id).hide();
				});
				animationNumber = 0;

				return;
			}

			if (btnForwardPressed(keyCode1)) {
				if (animationCount == 0) {
                setTimeout(() => {
                    $(nextSlideId).focus();
                }, 500);
                Reveal.next();
                return;
            }

				if (animationNumber >= 0 && animationNumber < animationCount) {
					let animation = currentAnimations[animationNumber];
					$(animation.id).toggle();
					const $animation = $(animation.id);
	
					let text = animation.text;
					if (text !== '') {
						$animation.textillate({
							loop: false,
							autoStart: true,
							in: {
								effect: text,
								delay: 750,
								sync: false,
								reverse: false,
								callback: function () {
								}
							},
							type: 'char'
						});
						$animation.textillate('start');
					} else {
						$animation.addClass(`animated ${animation.style}`);
					}

					animationNumber++;
					const currentSound = animation.sound;
					playSound(currentSound);
					return;
				}

				$.each(currentAnimations, (idx, animation) => {
					$(animation.id).hide();
				});
				animationNumber = 0;
				setTimeout(() => {
					$(nextSlideId).focus();
				}, 500);
				Reveal.next();
			}
		});
	}

	$.each(slides, (idx, slide) => {
			handle(slide);
	});
</script>
